import {
  FileText,
  Unlock,
  Circle,
  Settings,
  User,
  HelpCircle,
  Info,
  DollarSign,
  Clipboard,
  Mail,
  File
} from 'react-feather'
export default [
  {
    id: 'account',
    title: 'Account',
    icon: <User />,
    children: [
      {
        id: 'earnings',
        title: 'My Earnings',
        icon: <DollarSign />,
        navLink: '/pages/misc/ComingSoon'
      },
      {
        id: 'knowledgeBase',
        title: 'My Campaigns',
        icon: <Info />,
        navLink: '/pages/knowledge-base'
      },
      {
        id: 'screens',
        title: 'My Screens',
        icon: <Circle />,
        navLink: '/pages/account-settings/AccountTabContent'
      },
      {
        id: 'stream',
        title: 'My Stream',
        icon: <Circle />,
        navLink: '/pages/account-settings/AccountTabContent'
      },
     {
        id: 'vip',
        title: 'VIP Badges',
        icon: <Clipboard />,
        navLink: '/pages/account-settings/ConnectionsTabContent'
      }
    ]
  }
]
